import React, {Component} from 'react';
// import './Begin.css';
import 'tachyons';

class Begin extends Component{
	render(){
		return(
			<div className='f1 tc'>
				<h1> Welcome to React! </h1>
				<h3> 2019 </h3>
			</div>
		);
	}
}

export default Begin;
